            <div style="margin: 0in 0in 0pt; font: 12px verdana"><span style="font-family: Candara; font-size: 11pt"><font size="3">Hi, </font></span></div>
            <div style="margin: 0in 0in 0pt; font: 12px verdana"><font size="3">&nbsp;</font></div>
            <div style="margin: 0in 0in 0pt; font: 12px verdana"><span style="font-family: Candara; font-size: 11pt"><font size="3">I have an immediate requirement opening for a <strong><span style="background: yellow">Java Developer position in Albany, NY. This is a 10 months contract position</span></strong>. I would appreciate if you could send your updated word format resume along with best contact details ASAP.</font></span></div>
            <div style="margin: 0in 0in 0pt; font: 12px verdana"><font size="3">&nbsp;</font></div>
            <div style="margin: 0in 0in 0pt; font: 12px verdana"><strong><span style="font-family: Candara; font-size: 11pt"><font size="3">Here are the requirement details:</font></span></strong></div>
            <div style="margin: 0in 0in 0pt; font: 12px verdana"><font size="3">&nbsp;</font></div>
            <div style="margin: 0in 0in 0pt; font: 12px verdana"><span style="font-family: Candara; font-size: 11pt"><font size="3">Position &nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; : Java Developer</font></span></div>
