                <li style="margin: 0in 0in 0pt"><span style="font-family: Candara; font-size: 11pt"><font size="3">Experience designing software systems for hosted environments.</font></span></li>
                <li style="margin: 0in 0in 0pt"><span style="font-family: Candara; font-size: 11pt"><font size="3">Understanding of issues related to business logic in stored procedures vs. middle tier.</font></span></li>
                <li style="margin: 0in 0in 0pt"><span style="font-family: Candara; font-size: 11pt"><font size="3">Experience with web page templating frameworks in J2EE.</font></span></li>
